=== TOUR START: Adults only sailing day trip to Whitehaven Beach & Snorkelling ===
Google Tag Manager (noscript)
End Google Tag Manager (noscript)
Skip to primary navigation
Viper Outer Great Barrier Reef Tour
Coastal Explorer Coach Tours
Adults only sailing day trip to Whitehaven Beach & Snorkelling
Sail Elegantly to Whitehaven and Snorkel
Up to 24 Guests
Sail in style to Whitehaven Beach — where elegance meets adventure.
unlike any other in the Whitsundays. Enjoy a relaxed and intimate journey to the
, snorkel the fringing reefs of the Whitsunday Islands, and take in the breathtaking views on a
guided walk to Hill Inlet lookout
freshly prepared morning tea
gourmet lunch served onboard
with a complimentary glass of sparkling wine in hand. Designed exclusively for adults, this is refined adventure — the Lady Enid way.
8:00 AM – Departure from Coral Sea Marina:
Set sail aboard the beautiful Lady Enid, starting your day of adventure.
Sail to Tongue Bay:
Disembark and explore the stunning Whitsunday Island, with its lush landscapes and breathtaking views.
Hill Inlet & Iconic Swirling Sands:
Visit the famous Hill Inlet and its swirling white sands, a must-see natural wonder.
Spend time on the world-renowned Whitehaven Beach, where you can relax, swim in crystal-clear waters, or take a scenic walk to
, a secluded spot where you might have the entire beach to yourself.
Buffet Lunch on Board:
Enjoy a delicious buffet lunch served onboard, with plenty of fresh local flavors to fuel your afternoon.
Sail to a pristine snorkel spot, where you’ll dive into vibrant coral gardens and explore the colorful marine life of the Whitsundays.
back to port with a glass of Australian Sparkling and cheese and anti pasto platter.
This is a guideline only and is subject to change depending on the tides, winds, and other weather conditions
The only adults-only sailing tour in the Whitsundays, offering an intimate and relaxed atmosphere.
Only 24 guests with four crew.
Cruise through the stunning Whitsundays aboard a rare, traditional timber yacht, steeped in Australian maritime history.
Explore Whitehaven Beach & Hill Inlet:
Discover the world-famous swirling sands of Hill Inlet and the pristine beauty of Whitehaven Beach.
Indulge in a scrumptious morning tea, freshly prepared lunch featuring fresh prawns, and delightful snacks. Enjoy a glass of sparkling wine paired with a delicious antipasto and cheese platter as you sail back to port.
Snorkel the Fringing Reefs:
Dive into the crystal-clear waters to explore the vibrant marine life around the Whitsunday Islands’ fringing reefs.
Relax as you sail back into port, with the sun setting over the horizon, adding a magical end to your day.
Enjoy a more personal and attentive adventure with an intimate group size of 24 guests and 4 crew members designed for a magical day
A selection of tea, coffee or Hot chocolate.
Fresh scones with strawberry jam, clotted cream and fresh strawberries on top.
Prawns, Salmon, Chicken breast & Sliced ham
Sourdough bread and condiments
Quinoa and chickpea in a lemon sauce
Glass of Australian sparkling
Antipasto and cheese platter
We can cater to all dietary requirements, 24 hours notice is required.
Snorkel and Swim Requirements
Snorkelling is a physical activity.  To ensure a safe and enjoyable experience, we recommend that participants are competent and confident swimmers. While flotation devices are available, the snorkeling locations are in open ocean environments, which may have varying conditions, such as currents and waves.
Our experienced crew will guide you through safe entry and exit points and provide instructions before entering the water. This tour is not ideal for none swimmers or if you feel apprehensive about entering the ocean.   We encourage you to speak with our staff prior to booking.  Your safety and comfort are our top priorities.
Iconic Whitsunday Adventures always reserves the right, at its sole discretion, to accept, deny, or terminate participation by any person in any snorkelling activity at any time. This may be due to various medica
=== TOUR END: Adults only sailing day trip to Whitehaven Beach & Snorkelling ===
