Cruise the Sunset with Sundowner
Up to 48 Guests
Unwind from Dusk to Dark on a Sundowner Sunset Cruise
Start your evening in the most relaxing way possible — with a
, Airlie Beach’s favourite floating social event. Welcome the evening with a
glass of sparkling wine (or soft drink)
shared platter of fresh nibbles
as you cruise across the calm Coral Sea.
sunset over the Whitsunday Islands
, then take in the sparkling lights of Airlie Beach as they begin to twinkle across the water. Whether you’re here to connect with fellow travellers or simply soak up the views,
offers the perfect blend of
chilled-out cruising and good company
What Makes It Iconic
with music and smiles all round
views from the water
Licensed bar with your favourite drinks (no BYO)
friends, couples, and solo adventurers
looking to kick off the evening in style
Let go of the day and cruise into the night — laughter, music, and unforgettable sunsets await on
Meet us at Coral Sea Marina, North Village, at Meeting Point B. Departure times may vary depending on the sunset, so please check the schedule in advance.
As you step aboard, enjoy a glass of Australian sparkling wine and a shared antipasto platter, setting the tone for a relaxing evening.
Experience Airlie Beach from a unique perspective as we cruise the circumference of Pioneer Bay. Enjoy stunning views of the islands, seaside homes, all while watching Airlie Beach Hill light up as night falls.
Music & Social Vibes:
Relax to chilled sunset tunes then sing along to classic favorites. Whether you’re unwinding or engaging with fellow guests, the social atmosphere ensures a memorable time from start to finish.
From the transition of light to dark, to the sparkling lights of Airlie Beach, this cruise is more than just a boat ride. It’s an opportunity to connect, share stories, and enjoy an evening that feels completely different.
Return to Coral Sea Marina:
As the evening winds down, we’ll make our way back to the marina, leaving you with lasting memories of a perfect sunset cruise.
Bring your fun-loving spirit and a smile! This is all about enjoying good company, great music, and the beautiful Whitsundays.
Dress comfortably, bring your camera to capture the memories, and get ready for a relaxing, social evening on the water.
Cash or card to pay for drinks if desired (see our Bar Menu)
If you have any questions about this tour, the Sundowner, or our other tours, please check out our
Lady Enid Sunset Sail
Up to 28 guests
Savor a romantic two-hour sunset sail on the Lady Enid, complete with an Aperol Spritz and antipasto plate. Enjoy stunning Whitsunday views and intimate ambiance aboard this elegant timber yacht.
Airlie Beach Cruise and Dine
Up to 10 Guests
Enjoy a sunset cruise around Pioneer Bay with Sundowner Cruises, including a glass of sparkling wine and nibbles. Follow this with a cocktail and a two-course meal at Sorrento’s Restaurant.
Coral Sea Marina, Shingley Dr, Airlie Beach QLD 4802, Australia
