if ($('body').hasClass('post-password-protected')) {
    const postId = $('body').data('post-id');
    $.post('/wp-admin/admin-ajax.php', {
      action: 'password-protected',
      postId: postId,
    }, function(response) {
      let url = new URL(document.location.href);
      let params = new URLSearchParams(url.search);

      if (response) {
        // Post is authed, send to the cached auth version
        params.set('auth', response);
      } else {
        // Post is NOTH authed, remove the param
        params.delete('auth');
      }

      if([...params].length) {
        url = `${location.pathname}?${params}`;
      } else {
        url = location.pathname;
      }

      window.history.replaceState({}, '', url);
    });
  }
var getMixpanelButtonProperties = function(e) {
      var properties = {
        'destination': $(e).attr('href'),
      };

      if ($(e).data('mixpanel')) {
        properties['link-type'] = $(e).data('mixpanel');
      }

      if ($(e).data('custom-mixpanel-property')) {
        properties['custom-property'] = $(e).data('custom-mixpanel-property');
      }

      let buttonId = $(e).find('span[id]').attr('id');

      if (buttonId) {
        properties['button-id'] = buttonId;
      }

      return properties;
    };

    var sendEventToGTM = function(event, properties) {
        if (window.dataLayer) {
          window.dataLayer.push({
            'event': event,
            'destination': properties['destination'],
            'link-type': properties['link-type'] || null,  
            'button-id': properties['button-id'] || null,
            'custom-property': properties['custom-mixpanel-property'] || null
          });
        } else {
          console.error('GTM dataLayer not found.');
        }
      };

    var trackLinkClick = function(e, event) {
              window.mixpanel?.fareharbor.track(event, getMixpanelButtonProperties(e));
                    sendEventToGTM(event, getMixpanelButtonProperties(e));
          }; 

    FH.autoLightframe({
      overrideOnlick: 'all',
      callback: function(e) {

              gtag('event', {
          'send_to': 'G-4DLP6GYQN6',
          'event_category': 'Click FH Book Button',
          'event_label':  $(e).data('custom-mixpanel-property'),
        });
              gtag('event', {
          'send_to': 'G-6WXE90X597',
          'event_category': 'Click FH Book Button',
          'event_label':  $(e).data('custom-mixpanel-property'),
        });
              gtag('event', {
          'send_to': 'G-4F8KKNYQD3',
          'event_category': 'Click FH Book Button',
          'event_label':  $(e).data('custom-mixpanel-property'),
        });

      trackLinkClick(e, 'click-fhme-booking-link');
      }
    });

    $(function() {
      function isExternal(url) {
        if (url.indexOf('http') === -1) {
          return false;
        } else {
          return new URL(url).origin !== window.location.origin;
        }
      }

              let hasSBD = $('.activity-search').length > 0 ? 'true' : 'false';
        let hasQuickSearch =  $('.quick-search-button').length > 0 ? 'true' : 'false';
        let hasLearnMore =  $('.data-container').data('wants-learn-more') ? 'true' : 'false';
        let hasBookNow =  $('.data-container').data('wants-book-now') ? 'true' : 'false';
        let hasListView = $('.data-container').data('wants-list-view') ? 'true' : 'false';
        let hasIndividualTimes = $('.data-container').data('wants-individual-times') ? 'true' : 'false';
        let hasPublicHeadlines = $('.data-container').data('wants-individual-public-headlines') ? 'true' : 'false';
        let hasDataOnLoad = $('.data-container').data('wants-data-on-load') ? 'true' : 'false';

        if (!hasSBD) {
          window.mixpanel?.fareharbor.track("view-fhme-page", {
            'page-type': document.body.getAttribute('data-mixpanel-type'),
            'page-has-sbd': hasSBD
          });
        } else {
          window.mixpanel?.fareharbor.track("view-fhme-page", {
            'page-type': document.body.getAttribute('data-mixpanel-type'),
            'page-has-sbd': hasSBD,
            'sbd-quick-search': hasQuickSearch,
            'sbd-learn-more': hasLearnMore,
            'sbd-book-now': hasBookNow,
            'sbd-list-view': hasListView,
            'sbd-individual-times': hasIndividualTimes,
            'sbd-public-headlines': hasPublicHeadlines,
            'sbd-data-on-load': hasDataOnLoad
          });
        }


      $('a').not('[href*="fareharbor.com"]').on('click', function() {
        if (isExternal($(this).attr('href'))) {
          trackLinkClick(this, 'click-fhme-external-link');
        } else {
          trackLinkClick(this, 'click-fhme-internal-link');
        }
      });
    });
document.addEventListener('DOMContentLoaded', () => {
    const twoButtonContainers = document.querySelectorAll('.activity__two-button-container');
    twoButtonContainers.forEach((twoButtonContainer) => {
      const firstChild = twoButtonContainer.children[0].querySelector('.button');
      const secondChild = twoButtonContainer.children[1].querySelector('.button');
      const firstChildStyle = window.getComputedStyle(firstChild);
      const bgColor = firstChildStyle.getPropertyValue("background-color");
      const className = `change-color-${bgColor.replace(/[^a-zA-Z0-9-]/g, '-')}`;
      secondChild.style.boxShadow = 'inset 0 0 0 1px ' + bgColor;
      secondChild.style.color = bgColor;
      secondChild.classList.add(className);
    });
  });
